import React from "react";
import { NavLink } from "react-router-dom";

function Home() {
  return (
    <div className=" flex flex-col items-center w-full">
      <div className=" w-full text-center w-[80vw] bg-slate-400 h-auto">
        <NavLink
          to={"/"}
          className=" bg-green-700 w-[12.202562538133009vw] h-[6.101281269066504vw] p-4 rounded-md"
        >
          Anasayfa
        </NavLink>
        <NavLink
          to={"/addwords"}
          className=" bg-green-700 w-[12.202562538133009vw] h-[6.101281269066504vw] p-4 rounded-md"
        >
          Kelime Ekle
        </NavLink>
        <NavLink
          to={"/words"}
          className=" bg-green-700 w-[12.202562538133009vw] h-[6.101281269066504vw] p-4 rounded-md"
        >
          Kelimeler
        </NavLink>
      </div>
    </div>
  );
}

export default Home;
